body {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  padding: 0;
  border: 0;
  margin: 0;

  cursor: default;
  color: #888;
  background-color: #ffffff;

  text-align: center;
  font-family: Helvetica, Verdana, Arial, sans-serif;

  display: flex;
  flex-direction: column;
}

canvas {
  background-color: rgba(0, 0, 0, 0);
}

  width: 100%;
  height: 100%;
}

:root {
  --safe-top: env(safe-area-inset-top);
  --safe-right: env(safe-area-inset-right);
  --safe-bottom: env(safe-area-inset-bottom);
  --safe-left: env(safe-area-inset-left);
}

  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  width: 80vw;
  max-width: 400px;
  padding: 20px;
  border-radius: 10px;

  position: absolute;

  left: 50%;

}

#icon {
  width: 80px;
  height: 80px;
}

h2 {
  font-size: 1.5em;
  margin: 10px 0;
}

#progress-container {
  width: 100%;
  height: 10px;
  background-color: #ddd;
  border-radius: 5px;
  overflow: hidden;
  margin: 15px 0;
}

#progress-bar {
  width: 0%;
  height: 100%;
  background-color: #4caf50;
  transition: width 0.5s;
}

#loading-text {
  font-size: 1em;
  color: #333;
